import ExpenseItem from "./components/ExpenseItem";
import ExpenseBox from './components/ExpenseBox';
function App() {
  const expenses = [
    {
      title: "Car Insurance",
      amount: "300",
      date: new Date(2021,2,28),
    },
    {
      title: "Car Insurance",
      amount: "300",
      date: new Date(2021,2,28),
    },
    {
      title: "Car Insurance",
      amount: "300",
      date: new Date(2021,2,28),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseBox item={expenses}/>
    </div>
  );
}

export default App;
